CREATE TABLE mytable(
   Room_ID       INTEGER  NOT NULL PRIMARY KEY 
  ,Hotel_ID      INTEGER  NOT NULL
  ,Hotel_Name    VARCHAR(26) NOT NULL
  ,Address       VARCHAR(105) NOT NULL
  ,Room_Number   INTEGER  NOT NULL
  ,City          VARCHAR(11) NOT NULL
  ,Tariff        NUMERIC(6,1) NOT NULL
  ,Max_Occupants INTEGER  NOT NULL
  ,City_View     INTEGER  NOT NULL
  ,Comp_BF       INTEGER  NOT NULL
  ,WiFi          INTEGER  NOT NULL
  ,Car_Rental    INTEGER  NOT NULL
  ,AC            INTEGER  NOT NULL
);
RENAME TABLE mytable TO room_info;